import 'bootstrap/dist/css/bootstrap.min.css';
import logo from './logo.svg';
import Banner from './components/banner';
import Product from './components/product';
import NavBar from './components/navBar';
import './App.css';

import anImage from './image/solar-panels.jpg';

var numberOfProducts = [["Panel Solar de 500W", "500.00"], 
              ["Panel Solar de 380W", "380.00"], 
              ["Generador Eólico 1000W", "200.00"], 
              ["Producto 4", "0.00"], 
              ["Producto 5", "0.00"], 
              ["1", "42"], 
              ["1", "243.00"]];

function App() {
  return (
    <div className="App">
        <Banner bannerName= "Raide Energy"/>
        <NavBar/>
        {numberOfProducts.map((item,i) => <Product productName={item[0]} prodImage={anImage} posX={7 + (i%3)*30} posY={55 + Math.floor(i/3)*50} price={item[1]}/>)}
    </div>
  );
}

export default App;
